import React from 'react'
import harshit from './Images/harshit.jpg'

function Diseases() {
    const diseases=[{name:"Hairfall",url:harshit},
    {name:"Hairfall",url:harshit},
    {name:"Hairfall",url:harshit},
    {name:"Hairfall",url:harshit}]
    const renderDisease=(content,index)=>
    {
        return(
            <div className='cardDisease col-3'>
              <img src={content.url} alt ="first" width="300px" height="300px" style="border-radius:25px;"/>
              <h5>{content.name}</h5>
            </div>
        );
    }
  return (
    <div className='diseaseContainter row'>
      {diseases.map((content,index)=>(renderDisease(content,index)))}
    </div>
  )
}

export default Diseases
